    false,nt"url": null,nt"notes": "This annual narrative report for Ouray
    National Wildife Refuge outlines Refuge accomplishments during the 1991 calendar
    year.  The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the management plan and research and investigations. Refuge administration is outlined;
    information about personnel, funding, safety, and technical assistance is given.
    Habitat management is also covered; subjects include wetlands, forests, croplands,
    grasslands, fire management, pest control, and water rights. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries resources,
    and animal control. The public uses of the Refuge described in this report include
    interpretive programs, hunting, fishing, wildlife observation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation
    and equipment replacement. Cooperative programs are provided at the end.",nt"license_title":
